<div id="wrapper">
    <div id="left">
        <mat-card>
            <mat-card-header>
                <mat-card-title>
                    <mat-icon mat-icon>group</mat-icon>
                    <mat-checkbox [color]="'primary'">
                        Todos los grupos</mat-checkbox>
                </mat-card-title>
            </mat-card-header>
        </mat-card>
        <mat-card *ngFor="let groupDB of groups; let i = index">
            <mat-card-header>
                <mat-card-title>
                    <mat-checkbox [color]="'primary'">Grupo {{i + 1}}</mat-checkbox>
                </mat-card-title>
            </mat-card-header>
            <mat-chip-list>
                <mat-chip color="primary" *ngFor="let member of groupDB.getObjectDB().getGrupo()" selected>
                    {{member.getName()}}</mat-chip>
            </mat-chip-list>
        </mat-card>
    </div>
    <mat-divider [vertical]="true"></mat-divider>
